        this.state = {
            id : 1,
            description : 'Learn forms',
            targetDate : moment(new Date()).format('YYYY-MM-DD')
        }
    }
    render(){
        return(
            <div>
                <h1>todo</h1>
                <div className="container">
                    <Formik>
                        {
                            (props) => (
                                <div>Something</div>
                            )
                        }
                    </Formik>
                </div>
            </div>
        )
    }
}

export default TodoComponent;
